  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bowdoin NWR outlines
  Refuge accomplishments from May through August of 1953. The report begins by summarizing
  the weather conditions, water conditions, and food and cover during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, raptors, fish, and disease- is also covered. The Refuge
  development and maintenance section discusses physical developments, plantings,
  collections and receipts, and vegetation control. Resource management is outlined;
  topics include grazing and haying. A progress report on field investigations and
  applied research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, and Refuge participation. Items of interest,
  N-R forms, updates on the easement refuges, and photographs are attached.\",\n\t\"license_title\":
